(12, 1, '2019-08-26 18:00:05', '2019-08-26 18:00:05', '<!-- wp:paragraph {\"dropCap\":true,\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-drop-cap has-very-light-gray-color\"><strong>Sunganhou Company group</strong> est une start-up dans le domaine du digital et  L’électrification. Elle va de la conception à  la  réalisation &nbsp;des logiciels pour les entreprises, associations, particuliers. Elle est née en novembre 2018 et elle a participée au business challenge organisée par le  ministère de la Jeunesse et de   l’éducation civique.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>LE PROMOTEUR</strong>  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>Je suis Guy Merlin Tchagoua, 35 ans. Je suis étudiant chercheur(PhD) en didactique et technologie  éducative à l’université de  Yaoundé 1. Je suis jeune entrepreneur et fondateur de la start-up SUNGANHOU Company Group. Je suis également le président fondateur de l\'organisation panafricaine pour l\'entrepreneuriat des jeunes \"Panser l\'Afrique\" . </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5,\"align\":\"left\"} -->\n<h5 style=\"text-align:left\"> <strong>PROJET AUTOM-ELECT (AUTEL)</strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>Autom-Elect est un programme multi service qui allie électricité et numérique. Comment  ça marche?&nbsp;</strong> &nbsp; </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5> <strong>Fonctionnalité</strong>  </h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>AUTEL fonctionne automatiquement, c\'est un système intègre et interconnecte des objets dans un même champ visuel. En cas de danger ou de suspicion dans le périmètre bien  défini, tout le système d\'alerte déclenche.</strong>        </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>AUTEL propose les services suivants:</strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>-Conception et réalisation des circuits électriques</strong>,</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>CRECE</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>-Installation d\'un système d\'allumage automatique.  </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>INSAA</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"> <strong>-Système d\'alerte incendie : SALIN </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>-Solutions Solaires pour l’électrification rurale:SOSER  </strong></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5><strong>Etude de marché </strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph {\"textColor\":\"very-light-gray\"} -->\n<p class=\"has-text-color has-very-light-gray-color\"><strong>l\'environnement du marché : notre marché est prioritairement la zone urbaine car il y existe une insécurité remarquable. Les gens se font braquer, cambrioler tous les jours.  </strong> </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>   </p>\n<!-- /wp:paragraph -->', 'A-propos', '', 'publish', 'closed', 'closed', '', 'apropos', '', '', '2019-09-10 08:45:41', '2019-09-10 08:45:41', '', 0, 'http://localhost/wordpress/?page_id=12', 0, 'page', '', 0),
