(98, 1, '2019-08-30 18:56:47', '2019-08-30 18:56:47', '<!-- wp:gallery {\"ids\":[96]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2019/08/canadian-flag-small-3.gif\" alt=\"\" data-id=\"96\" data-link=\"http://localhost/wordpress/membres/canadian-flag-small-3/\" class=\"wp-image-96\"/><figcaption>Msr Guy Merlin Tchagoua (CEO)</figcaption></figure></li></ul>\n<!-- /wp:gallery -->\n\n<!-- wp:gallery {\"ids\":[97]} -->\n<ul class=\"wp-block-gallery columns-1 is-cropped\"><li class=\"blocks-gallery-item\"><figure><img src=\"http://localhost/wordpress/wp-content/uploads/2019/08/codepickin-1.jpg\" alt=\"\" data-id=\"97\" data-link=\"http://localhost/wordpress/membres/codepickin-1/\" class=\"wp-image-97\"/><figcaption> <br> <br> <br> <br> <br> <br> <br>Amanye Sirri Cecile (Développeur D\'application)</figcaption></figure></li></ul>\n<!-- /wp:gallery -->', 'Membres', '', 'inherit', 'closed', 'closed', '', '34-revision-v1', '', '', '2019-08-30 18:56:47', '2019-08-30 18:56:47', '', 34, 'http://localhost/wordpress/blog/2019/08/30/34-revision-v1/', 0, 'revision', '', 0),
(100, 1, '2019-08-30 19:34:58', '2019-08-30 19:34:58', '<!-- wp:paragraph -->\n<p><strong>Sunganhou Company group</strong> est une start-up dans le domaine du digital et  L’électrification. Elle va de la conception à  la  réalisation &nbsp;des logiciels pour les entreprises, associations, particuliers. Elle est née en novembre 2018 et elle a participée au business challenge organisée par le  ministère de la Jeunesse et de   l’éducation civique.</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p><strong>LE PROMOTEUR</strong>  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>Je suis <strong>Guy Merlin Tchagoua</strong>, 35 ans. Je suis étudiant chercheur(PhD) en didactique et technologie  éducative à l’université de  Yaoundé 1. Je suis jeune entrepreneur et fondateur de la start-up SUNGANHOU Company Group. Je suis également le président fondateur de l\'organisation panafricaine pour l\'entrepreneuriat des jeunes <strong>\"Panser l\'Afrique\" </strong>. </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5,\"align\":\"left\"} -->\n<h5 style=\"text-align:left\"> <strong>PROJET AUTOM-ELECT (AUTEL)</strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>Autom-Elect est un programme multi service qui allie électricité et numérique. Comment  ça marche?    </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5> <strong>Fonctionnalité</strong>  </h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>AUTEL fonctionne automatiquement, c\'est un système intègre et interconnecte des objets dans un même champ visuel. En cas de danger ou de suspicion dans le périmètre bien  défini, tout le système d\'alerte déclenche.        </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>AUTEL propose les services suivants:</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Conception et réalisation des circuits électriques,</p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>CRECE</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>-Installation d\'un système d\'allumage automatique.  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5>INSAA</h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p> -Système d\'alerte incendie : SALIN </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>-Solutions Solaires pour l’électrification rurale:SOSER  </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:heading {\"level\":5} -->\n<h5><strong>Etude de marché </strong></h5>\n<!-- /wp:heading -->\n\n<!-- wp:paragraph -->\n<p>l\'environnement du marché : notre marché est prioritairement la zone urbaine car il y existe une insécurité remarquable. Les gens se font braquer, cambrioler tous les jours.   </p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p></p>\n<!-- /wp:paragraph -->\n\n<!-- wp:paragraph -->\n<p>   </p>\n<!-- /wp:paragraph -->', 'A-propos', '', 'inherit', 'closed', 'closed', '', '12-revision-v1', '', '', '2019-08-30 19:34:58', '2019-08-30 19:34:58', '', 12, 'http://localhost/wordpress/blog/2019/08/30/12-revision-v1/', 0, 'revision', '', 0),
(102, 1, '2019-08-30 19:38:31', '2019-08-30 19:38:31', '<!-- wp:heading -->\n<h2>Conseil et formation</h2>\n<!-- /wp:heading -->\n\n<!-- wp:media-text {\"mediaId\":39,\"mediaType\":\"image\",\"isStackedOnMobile\":true} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/wordpress/wp-content/uploads/2019/08/iconmonstr-idea-15.png\" alt=\"\" class=\"wp-image-39\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:list -->\n<ul><li>Conseil, formation et placement en emploi</li></ul>\n<!-- /wp:list --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:heading -->\n<h2>Maintenance</h2>\n<!-- /wp:heading -->\n\n<!-- wp:media-text {\"mediaId\":47,\"mediaType\":\"image\"} -->\n<div class=\"wp-block-media-text alignwide\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/wordpress/wp-content/uploads/2019/08/iconmonstr-android-os-2.png\" alt=\"\" class=\"wp-image-47\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:list -->\n<ul><li>Fabrication de logiciels de gestion (RH, compta, onshore, nearshore, offshore)</li><li>Maintenance des appareils  électroniques ,</li><li>Montage et installation de circuit  électrique ,</li><li>Eclairage public,</li></ul>\n<!-- /wp:list --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:heading -->\n<h2>Conception et Design</h2>\n<!-- /wp:heading -->\n\n<!-- wp:media-text {\"mediaId\":39,\"mediaType\":\"image\",\"isStackedOnMobile\":true} -->\n<div class=\"wp-block-media-text alignwide is-stacked-on-mobile\"><figure class=\"wp-block-media-text__media\"><img src=\"http://localhost/wordpress/wp-content/uploads/2019/08/iconmonstr-idea-15.png\" alt=\"\" class=\"wp-image-39\"/></figure><div class=\"wp-block-media-text__content\"><!-- wp:list -->\n<ul><li>Conception de sitewebs à partir de 50.000FCFA (nom de domaine + hebergement pendant un an,</li><li> Publicité multimedia de votre structure sur internet,</li><li>Promotion des produits locaux. </li></ul>\n<!-- /wp:list --></div></div>\n<!-- /wp:media-text -->\n\n<!-- wp:paragraph {\"textColor\":\"vivid-cyan-blue\",\"fontSize\":\"medium\"} -->\n<p class=\"has-text-color has-medium-font-size has-vivid-cyan-blue-color\"><strong>Rapidité, efficacité et bon travail sont nos maîtres mots.</strong></p>\n<!-- /wp:paragraph -->', 'Services', '', 'inherit', 'closed', 'closed', '', '22-revision-v1', '', '', '2019-08-30 19:38:31', '2019-08-30 19:38:31', '', 22, 'http://localhost/wordpress/blog/2019/08/30/22-revision-v1/', 0, 'revision', '', 0),
